import React            from 'react';
import { connect }      from 'react-redux';
import Center           from '../../components/center/center.component';
import ScanboxContainer from '../../components/left/left.component'
import ReportsContainer from '../../components/right/right.component';
import AvailableUnits   from '../../components/modals/available-assets.modal';
import QuarantinedUnits from '../../components/modals/quarantined-assets.modal';
import UnitsInUse       from '../../components/modals/assets-in-use.modal';
import AddUser          from '../../components/modals/add-user.modal';
import AddUnit          from '../../components/modals/add-unit.modal';

import { HomepageContainer } from "./homepage.styles";

const HomePage = ({seenAvailableUnits, seenUnitsInUse, seenQuarantinedUnits, seenAddUser, seenAddUnit}) => {

    return (
        <HomepageContainer>
            <ScanboxContainer/>
            <Center/>
            <ReportsContainer/>
            {/* Toggle the Action Panel Modals */}
            {seenAvailableUnits   ? <AvailableUnits/>   : null}
            {seenUnitsInUse       ? <UnitsInUse/>       : null}
            {seenQuarantinedUnits ? <QuarantinedUnits/> : null}
            {seenAddUser          ? <AddUser/>          : null}
            {seenAddUnit          ? <AddUnit/>          : null}
        </HomepageContainer>
    );
};

const mapStateToProps = (state) => ({
    seenAvailableUnits  : state.modalState.seenAvailableUnits,
    seenQuarantinedUnits: state.modalState.seenQuarantinedUnits,
    seenUnitsInUse      : state.modalState.seenUnitsInUse,
    seenAddUser         : state.modalState.seenAddUser,
    seenAddUnit         : state.modalState.seenAddUnit
})

export default connect(mapStateToProps)(HomePage);
